import React from "react";
import { BrowserRouter as Router, Switch, Route } from "react-router-dom";
import { DataProvider } from "./GlobalState";
import "./App.css";
import { Home } from "./pages/Home/Home";

import Products from "./pages/Producto/Products";
import { SingUp } from "./pages/SingUp/SingUp";
import DetailProduct from "./components/mainpages/detailProduct/DetailProduct";
import { Register } from "./pages/Registro/Register";
import Cart from "./pages/Cart/Cart";
import Cart2 from "./pages/Cart2/Cart2";
import Navbar from "./components/Navbar/Navbar";
import Footer from "./components/Footer-ContactUs/Footer";

function App() {
  // const state = useContext(GlobalState);
  // const [isLogged] = state.userApi.isLogged;
  return (
    <DataProvider>
      <Router>
        {/* <div className="App"> */}
        {/* <Navbar /> */}
        <Switch>
          <Route path="/" exact component={Home} />
          <Route path="/services" component={Services} />
          <Route path="/sign-up" component={SingUp} />
          <Route path="/register" exact component={Register} />
        </Switch>
        {/* </div> */}
      </Router>
      <Router>
        <Navbar />
        <Switch>
          <Route path="/products" component={Products} />
          <Route path="/detail/:id" exact component={DetailProduct} />
          <Route path="/cart" exact component={Cart} />
        </Switch>
        <Footer />
      </Router>
    </DataProvider>
  );
}

export default App;
